
const element = document.querySelector('a.butt');

function createDelugeButton(element) {
    const myButton = document.createElement("a")
    myButton.className = "butt"
    myButton.textContent = "Envoyer a deluge"
    myButton.style.borderColor = "#4975d1"
    myButton.style.color = "white"
    myButton.style.marginLeft = "5px"
    myButton.addEventListener("mouseenter", () => {
        myButton.style.backgroundColor = "#4975d1"
    })
    myButton.addEventListener("mouseleave", () => {
        myButton.style.backgroundColor = element.style.color
    })
    myButton.addEventListener("click", () => {
        addTorrentToDeluge(getTorrentLink(), getCategorie())
    })
    element.parentElement.appendChild(myButton)
}

function getCategorie() {
    const categories = {
        "2183": "radarr",
        "2184": "sonarr",
        "2179": "sonarr",
        "2178": "radarr",
        "2148": "lidarr"
    }
    const div = document.querySelector("div.tag")
    const regexp = /tag_subcat_(\d+)/
    const id = div.className.match(regexp)[1]
    if (id in categories) {
        return categories[id]
    }
}

function getTorrentLink() {
    return element.getAttribute("href")
}

function addTorrentToDeluge(link, label) {
    chrome.runtime.sendMessage(
        {
            action: "addTorrent",
            link: link,
            label: label,
        }
    );
}

function updateProwlarr() {
    chrome.runtime.sendMessage(
        {
            action: "prowlarr"
        }
    );
}

function createProwlarrButton() {
    let rotation = 0
    function getBase64() {
        return `data:image/png;base64,`;
    }
    const prowlarrButton = document.createElement("button")
    const img = document.createElement("img")
    img.src = getBase64();

    prowlarrButton.style.position = "absolute"
    prowlarrButton.style.zIndex = "999999"
    prowlarrButton.style.border = "none"
    prowlarrButton.style.background = "none"
    prowlarrButton.style.top = "10px"
    prowlarrButton.style.left = "10px"
    prowlarrButton.style.width = "40px"
    prowlarrButton.style.height = "40px"

    img.style.width = prowlarrButton.style.width
    img.style.height = prowlarrButton.style.height
    img.style.transition = "transform 1s ease-in-out"

    prowlarrButton.addEventListener("click", () => {
        rotation += 360
        img.style.transform = `rotate(${rotation}deg)`
        updateProwlarr()
    })

    prowlarrButton.appendChild(img)
    document.body.appendChild(prowlarrButton)
}

if (element) {
    createDelugeButton(element)
}
if (location.pathname !== "/auth/login") {
    createProwlarrButton()
}
